import React from "react";
import image1 from "../images/Rectangle 15.png";
import image2 from "../images/Rectangle 16.png";
import image3 from "../images/Rectangle 17.png";
import image4 from "../images/Rectangle 18.png";
import image5 from "../images/Rectangle 19.png";
import image6 from "../images/Rectangle 20.png";

const Sections = () => {
  return (
    <section id="sections">
      <div className="container">
        <div className="sections">
          <img src={image1} alt="" />
          <div className="images1">
            <img className="image_2" src={image2} alt="" />
            <div className="images2">
              <img src={image3} alt="" />
              <img src={image5} alt="" />
              <img src={image4} alt="" />
              <img src={image6} alt="" />
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Sections;
